// src/controllers/getAllColorsStock.ts
async function getAllColorsStock(c) {
  const stock = await db.select().from(stockTable);
  return c.json(stock);
}

// src/controllers/deleteColorStock.ts
async function deleteColorStock(c) {
  const name = c.req.param("name").toLowerCase();
  const result = await db.delete(stockTable).where(sql`LOWER(${stockTable.name}) = ${name}`);
  if (result.rowsAffected === 0) {
    return c.json({ error: "Product not found" }, 404);
  }
  return c.json({ message: "Product deleted successfully" }, 200);
}

