// src/controllers/getAllFormulas.ts
async function getAllFormulas(c) {
  const formulas = await db.select().from(formulaTable).all();
  const result = await Promise.all(formulas.map(async (formula) => {
    const ingredients = await db.select().from(formulaIngredientTable).where(sql`${formulaIngredientTable.formulaId} = ${formula.id}`).all();
    return {
      ...formula,
      ingredients
    };
  }));
  return c.json(result);
}

// src/controllers/getOneFormula.ts
async function getOneFormula(c) {
  const name = c.req.param("name").toLowerCase();
  const formula = await db.select().from(formulaTable).where(sql`LOWER(${formulaTable.name}) = ${name}`).get();
  if (!formula) {
    return c.json({ error: "Formula not found" }, 404);
  }
  const ingredients = await db.select().from(formulaIngredientTable).where(sql`${formulaIngredientTable.formulaId} = ${formula.id}`).all();
  return c.json({
    ...formula,
    ingredients
  });
}

// src/controllers/deleteFormula.ts
async function deleteFormula(c) {
  const name = c.req.param("name").toLowerCase();
  const formula = await db.select().from(formulaTable).where(sql`LOWER(${formulaTable.name}) = ${name}`).get();
  if (!formula) {
    return c.json({ error: "Formula not found" }, 404);
  }
  await db.delete(formulaIngredientTable).where(sql`${formulaIngredientTable.formulaId} = ${formula.id}`);
  await db.delete(formulaTable).where(sql`${formulaTable.id} = ${formula.id}`);
  return c.json({ message: "Formula deleted successfully" });
}

